import styled from 'styled-components'

const DetailsContainer = styled.div`
  display: flex;
  flex-flow: column;
`

const DetailsName = styled.h1`
  font-family: 'Industry';
  color: #FF7E26;
  font-size: 3rem;
  font-weight: bold;
`

const Details = props => (
  <DetailsContainer>
    <DetailsName>Oil Tank</DetailsName>

  </DetailsContainer>
)

export default Details
